// js/font.js

(function (global) {
  // --- IMPORTANT: REPLACE WITH YOUR ACTUAL BASE64 FONT DATA ---
  // Generate these using an online TTF to Base64 converter, or a local tool.
  // Ensure you get the raw Base64 string, not one wrapped in CSS @font-face, etc.
  const interRegularBase64 =
    "";
  const interBoldBase64 =
    "AAEAAAAPAIAAAwBQRkZUTBadsrAreAA...YOUR_VERY_LONG_INTER_BOLD_BASE64_STRING_HERE..."; // If you use bold

  // Function to be called by jsPDF when it's ready for fonts
  function addCustomFonts(jsPDFAPI) {
    // Check if the placeholder data is still there
    if (
      interRegularBase64.startsWith("AAEAAAAPAIAAAwBQRkZUTBadAreAAA...") ||
      interRegularBase64.length < 1000
    ) {
      console.warn(
        "Placeholder for Inter-Regular base64 data not replaced in font.js. 'Inter normal' will not be embedded."
      );
    } else {
      try {
        jsPDFAPI.addFileToVFS("Inter-Regular.ttf", interRegularBase64);
        jsPDFAPI.addFont("Inter-Regular.ttf", "Inter", "normal");
        console.log(
          "Custom font 'Inter' (normal) has been registered with jsPDF."
        );
      } catch (e) {
        console.error("Error registering 'Inter' (normal):", e);
      }
    }

    // Register Bold variant if you have it and intend to use it
    if (
      interBoldBase64.startsWith("AAEAAAAPAIAAAwBQRkZUTBadsrAreAA...") ||
      interBoldBase64.length < 1000
    ) {
      console.warn(
        "Placeholder for Inter-Bold base64 data not replaced or missing in font.js. 'Inter bold' will not be embedded if used."
      );
    } else {
      try {
        jsPDFAPI.addFileToVFS("Inter-Bold.ttf", interBoldBase64);
        jsPDFAPI.addFont("Inter-Bold.ttf", "Inter", "bold");
        console.log(
          "Custom font 'Inter' (bold) has been registered with jsPDF."
        );
      } catch (e) {
        console.error("Error registering 'Inter' (bold):", e);
      }
    }
  }

  // Hook into jsPDF's font processing
  // This ensures that addCustomFonts is called at the correct time by jsPDF itself.
  // The `this` context within the event callback will be the jsPDF document instance.
  if (
    typeof global.jspdf !== "undefined" &&
    typeof global.jspdf.jsPDF !== "undefined" &&
    global.jspdf.jsPDF.API &&
    global.jspdf.jsPDF.API.events
  ) {
    global.jspdf.jsPDF.API.events.push([
      "addFonts",
      function () {
        // 'this' inside here is the jsPDF document instance
        addCustomFonts(this);
      },
    ]);
    console.log("font.js: Hooked into jsPDF addFonts event.");
  } else {
    console.error(
      "font.js: jsPDF or its API/events are not available. Custom fonts cannot be registered. Ensure jsPDF is loaded before font.js."
    );
    // As a fallback, you could try to run addCustomFonts on DOMContentLoaded,
    // but it would need access to a jsPDF instance, which is tricky globally.
    // The event hook is the preferred method.
  }
})(window); // Pass the global object (window in browsers)
